script: |
  super -f text -I q8511.spq | sort > q8511.out

inputs:
  - name: q8511.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE - 12 + + 75 / + col2 NOT BETWEEN NULL AND - - col2 * col0 / - 88 * + col0 + - 28 * + col0 * + - col1 * + - 30 + - + 93 * col1 / + 93;
  - name: tab2

outputs:
  - name: q8511.out
    data: |
      46	51	23
      64	77	40
      75	67	58
